window.bookSummaryJSON = "<p>“A unique voice on money, one singularly attuned to...his generation.” (<i>San Francisco Chronicle</i>) </p> <p>Buy as many lattes as you want. Spend extravagantly on the things you love. Live your rich life instead of tracking every last expense with Ramit Sethi’s simple, powerful, and effective six-week program for gaining control over your finances. </p> <p>This isn’t typical advice from a money expert. In this completely updated second edition, Ramit teaches you how to choose long-term investments and the right bank accounts. With his characteristic no-BS perspective, he shows how to squeeze every hidden benefit out of your credit cards. Crush debt and student loans. Learn the exact words to negotiate a raise. Set up an automatic payment system and get on with your life. Plus, new material on overcoming psychological barriers, love and money, new investments options, and real audience stories of how applying Ramit’s principles led to a rich life. </p> <p>“Don’t let the breezy, irreverent style of this book fool you. It contains serious advice on personal-finance decisions, from budgeting and savings to spending and investing.” (Burton G. Malkiel, author of <i>A Random Walk Down Wall Street</i>)</p> <p><b>PLEASE NOTE: When you purchase this title, the accompanying PDF will be available in your Audible Library along with the audio.</b></p>"; 
